  "description": "<p>This unique formula helps stimulate the movement and removal of ingested hair, reducing the occurrence of hairballs. It is also balanced to maintain the ideal weight and proper urinary health of your cat.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Optimal Nutrient Profile</li>\n<li>Healthy weight</li>\n<li>Hairball reduction</li>\n<li>Urinary health</li>\n<li>Protein content - 32%</li>\n</ul>\n<p><strong>Ingredients:</strong></p>\n<p><span>Composition: dehydrated poultry protein, rice, wheat, animal fats, maize, vegetable fibres, wheat flour, hydrolysed animal proteins, vegetable protein isolate*, maize gluten, yeasts and parts thereof, beet pulp, soya oil, fish oil, psyllium husks and seeds, minerals, hydrolysed yeast (source of manno-oligo-saccharides), marigold extract (source of lutein).</span><br><br><span><strong>Additives (per kg):</strong> Nutritional additives: Vitamin A: 13000 IU, Vitamin D3: 700 IU, E1 (Iron): 32 mg, E2 (Iodine): 3.2 mg, E4 (Copper): 10 mg, E5 (Manganese): 42 mg, E6 (Zinc): 126 mg, E8 (Selenium): 0.08 mg - Zootechnical additives: Ammonium chloride: 5 g - Preservatives - Antioxidants.</span><br><br><span><strong>Analytical constituants:</strong> Protein: 32% - Fat content: 15% - Crude ash: 7.2% - Crude fibres: 4.6%.</span></p>\n<p><strong>HUFT Tip: </strong>As your cat grows, his or her energy requirements and levels of activity change too. Following the feeding guides on the packaging helps you to get a rough idea of what your cat needs to eat to maintain a good body structure. Consult a vet for exact quantities.</p>",
