  "handle": "sheba-maguro-bream-wet-cat-food-35-g",
  "description": "<p><span>Nothing says love like Sheba's range of premium Cat Food, containing a special fish mix that your cat will love and adore. Your adult pet cat adores the taste of real meat and Sheba ensures your cat savours every bit of it through its range of premium cat food. This protein in gravy cat food recipe also contains essential vitamins and minerals, so this premium palate for your cat delivers a mouth-watering feast, without compromising on the goodness, making it an ideal for cats. Treat your furry friend to the satisfying taste of Sheba Feast of Flakes, wet cat food because believe it or not, Sheba is what your cat wants.</span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li><span class=\"a-list-item\">Premium cat food for your special furry friend</span></li>\n<li><span class=\"a-list-item\">Rich fish mix with Maguro &amp; Bream in Gravy, an ideal</span></li>\n<li><span class=\"a-list-item\">Min. 10% Protein in each pouch for cat's complete nutrition</span></li>\n<li><span class=\"a-list-item\">The high-quality meal offers a tantalizing texture</span></li>\n<li><span class=\"a-list-item\">for cat with a pleasing consistency, ideal for adult cats</span></li>\n<li><span class=\"a-list-item\">Great calorific value in a small serving size - 20Kcal/1pack</span></li>\n<li><span class=\"a-list-item\">Suited for Persian Cat, British Shorthair to Siamese Cat</span></li>\n</ul>\n<p><strong>Ingredients: </strong>Fish (Bonito, White Meat Fish, Bream, Maguro extract), Dried Bonito Flakes, Polysaccharide thickener, Seasoning (Amino Acids)Fish (Bonito, White Meat Fish, Bream, Maguro extract), Dried Bonito Flakes, Polysaccharide thickener, Seasoning (Amino Acids)</p>\n<p><strong>Nutritional Facts: </strong>Crude Fibre: 0.1% (Max), Ash: 2.5% (Max), Protein : 10.0% (Min), Fat : 0.4% (Min), ME Value: 20 kcal/1 Pack, Moisture : 87.0 % (Max)</p>\n<div style=\"text-align: center;\" data-mce-style=\"text-align: center;\"><img style=\"float: none;\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/a6d82ab1-5c7e-4698-ab61-23e1665193b3._CR6_0_232_232_PT0_SX220_240x240.jpg?v=1627039689\" alt=\"\" data-mce-style=\"float: none;\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/a6d82ab1-5c7e-4698-ab61-23e1665193b3._CR6_0_232_232_PT0_SX220_240x240.jpg?v=1627039689\"></div>\n<h3 style=\"text-align: center;\" data-mce-style=\"text-align: center;\">Appealing Flavour</h3>\n<h2>A medley of soft and delicate pieces in delicious gravy, Sheba is loved by cats.</h2>\n<div style=\"text-align: center;\" data-mce-style=\"text-align: center;\"><img style=\"float: none;\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/740818f6-c7eb-4d6e-af41-21930c9a2f3d._CR6_0_232_232_PT0_SX220_240x240.jpg?v=1627039700\" alt=\"\" data-mce-style=\"float: none;\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/740818f6-c7eb-4d6e-af41-21930c9a2f3d._CR6_0_232_232_PT0_SX220_240x240.jpg?v=1627039700\"></div>\n<h3 style=\"text-align: center;\" data-mce-style=\"text-align: center;\">Premium Nutrition</h3>\n<h2>The thoughtful fish mixes ensure premium proteins and moisture in each recipe.</h2>\n<p class=\"a-size-small\"><br></p>\n<div style=\"text-align: center;\" data-mce-style=\"text-align: center;\"><img style=\"float: none;\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/897aa405-53af-42f7-b960-047de1297cbb._CR6_0_232_232_PT0_SX220_240x240.jpg?v=1627039709\" alt=\"\" data-mce-style=\"float: none;\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/897aa405-53af-42f7-b960-047de1297cbb._CR6_0_232_232_PT0_SX220_240x240.jpg?v=1627039709\"></div>\n<div style=\"text-align: center;\" data-mce-style=\"text-align: center;\"><br></div>\n<h3 style=\"text-align: center;\" data-mce-style=\"text-align: center;\">Gourmet Ingredients</h3>\n<h2>With fish as the ingredient, Sheba ensures a wholesome feast for cats.</h2>\n<div><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/fe172582-565e-4b2e-99aa-7efa0b118cdc._CR0_0_300_300_PT0_SX300_160x160.png?v=1627039727\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/fe172582-565e-4b2e-99aa-7efa0b118cdc._CR0_0_300_300_PT0_SX300_160x160.png?v=1627039727\"></div>\n<h3>Why can not I Feed Her What I Eat or Cook?</h3>\n<p class=\"a-spacing-base\" data-mce-fragment=\"1\">Cats are obligate carnivores and require high levels of protein and nutrients like taurine, which cannot be met by home-cooked diets.</p>\n<h3 style=\"text-align: left;\" class=\"a-spacing-mini a-color-secondary\" data-mce-fragment=\"1\" data-mce-style=\"text-align: left;\">What Not to Feed to your Cat?</h3>\n<p class=\"a-spacing-base\" data-mce-fragment=\"1\">Baby food or too much milk, onion, garlic, raw eggs, chocolate, raw fish, chicken bones and uncooked meat.</p>\n<h3 style=\"text-align: left;\" class=\"a-spacing-mini a-color-secondary\" data-mce-fragment=\"1\" data-mce-style=\"text-align: left;\">Does My Cat Need Milk?</h3>\n<p class=\"a-spacing-base\" data-mce-fragment=\"1\">Cats do not need milk with their food as cats may often lose their ability to digest milk as they age, which can cause loose stools and digestive disturbances.</p>\n<div><img src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/17cd580c-a31d-4030-a046-1bb8f1720087._CR0_0_300_300_PT0_SX300_240x240.png?v=1627039737\" alt=\"\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/17cd580c-a31d-4030-a046-1bb8f1720087._CR0_0_300_300_PT0_SX300_240x240.png?v=1627039737\"></div>\n<h3><strong>How Much Sheba Gravy Must Be Fed?</strong></h3>\n<p>Feed Sheba fish mix as a complementary meal with a complete and balanced cat food like Whiskas. Note: Supply fresh water at all times.</p>\n<p><strong>HUFT Tip:</strong><b> </b>Senior pets may not have a sense of smell that is as strong as before. Wet food has a stronger smell than dry kibble and this is why it is easier to tempt your senior cats with wet food.</p>",
