  "title": "Whiskas Ocean Fish Adult Dry Cat Food",
  "handle": "whiskas-ocean-fish-dry-food-for-adult-cats-available-in-multiple-sizes",
  "description": "<p>These flavourful pockets are not just loaded with irresistible mackerel but are also rich in nutrients. Whiskas has been working with the experts at the WALTHAM Centre for Pet Nutrition to create nourishing diets that your cat will love. Whiskas cat food contains a unique patented combination of zinc + omega 6 fatty acids that help to improve your pet's skin and coat.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Suitable for adult cats above 1 year</li>\n<li>Contains ocean fish and poultry</li>\n<li>Patent protected combination of zinc + omega 6 fatty acids</li>\n<li>AAFCO approved</li>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never feed above recommended quantities unless prescribed by a vet</li>\n</ul>\n<p><strong>Feeding Guidelines: </strong>Feeding requirements will vary based on your pet's level of activity, environment and age.</p>\n<p><img alt=\"\" src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/1_d3bc06ec-75ac-4833-88e4-20a4c76afee6_large.JPG?v=1556951119\" data-mce-src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/1_d3bc06ec-75ac-4833-88e4-20a4c76afee6_large.JPG?v=1556951119\"></p>\n<p><strong>Please Note: </strong><span></span>This is just an initial guide, we suggest you check with a vet for specific changes in quantity to suit your pet.</p>\n<p><strong>Ingredients: </strong>Wholegrain cereals (corn, rice, wheat), corn gluten meal, poultry and poultry by-products, soy bean products, (full fat soy bean, soybean meal) palm stearin, ocean fish, wheat flour, minerals, iodised salt, vitamins, taurine, soy oil, methionine, food colouring, preservatives, flavour.</p>\n<p><strong>Analytical Constituents (%):</strong></p>\n<p><strong><img alt=\"\" src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/1.1_ac46223e-784d-4575-a916-06aee6aca4f7_large.JPG?v=1556951124\" data-mce-src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/1.1_ac46223e-784d-4575-a916-06aee6aca4f7_large.JPG?v=1556951124\"></strong></p>\n<p><strong>HUFT Tip: </strong><span style=\"font-size: 0.875rem;\">Cats are fussy eaters and may go a couple of meals without touching the food if they don't like it. Don't let your cat go without food for longer than 24 hours. Take your pet to the vet and watch for tiny behavioural changes if this happens.</span></p>",
