  "title": "Royal Canin Instinctive Wet Cat Food - 85 g packs",
  "handle": "royal-canin-instinctive-wet-cat-food-85-g-pack-of-4",
  "description": "<p><span>When feeding your cat, it is possible to align what it actually wants to eat with what it needs to eat in order to maintain nutritional health. Choosing the right food for your cat is essential in supporting a healthy lifestyle, and the benefit of your cat enjoying its food makes it all the better. ROYAL CANIN Instinctive in Gravy is formulated to match the optimal Macro Nutritional Profile instinctively preferred by adult cats. With carefully selected nutrients included for optimal palatability, the end product is a dish that your cat simply won't be able to resist. Thanks to the inclusion of a vast assortment of vitamins, minerals and amino acids (all needed to maintain general health and regular growth), your cat will be consuming a highly-digestible and nutritionally-balanced food. The combination of nutrients has not only been designed to be instinctively edible and nutritionally healthy, they've also been formulated to help your cat maintain an ideal weight and support a healthy urinary system. ROYAL CANIN Instinctive in Gravy contains an optimal level of fat content for provision of energy levels. Additionally, the fibre blend and protein contributes to the feeling of being full. To cater to each cat's individual preferences, ROYAL CANIN Instinctive is also available in succulent jelly or as a tasty loaf.</span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>\n<b data-mce-fragment=\"1\">Instinctively preferred :<span data-mce-fragment=\"1\"> </span></b><span data-mce-fragment=\"1\">Instinctive is formulated to match the optimal nutritional profile instinctively preferred by adult cats.</span>\n</li>\n<li>\n<b data-mce-fragment=\"1\">Healthy urinary system :<span data-mce-fragment=\"1\"> </span></b><span data-mce-fragment=\"1\">Helps support a healthy urinary system.</span>\n</li>\n<li>\n<b data-mce-fragment=\"1\">Maintains ideal weight :<span data-mce-fragment=\"1\"> </span></b><span data-mce-fragment=\"1\">Formulated to help maintain ideal weight.</span>\n</li>\n</ul>\n<p><strong>Ingredients:</strong></p>\n<p><strong>Composition:</strong> Meat and animal derivatives, fish and fish derivatives, vegetable protein extracts, cereals, derivatives of vegetable origin, minerals, various sugars.<br><br><strong>Additives (per kg): Nutritional additives:</strong> Vitamin D3: 35IU, E1 (Iron): 3mg, E2 (Iodine): 0.35mg, E4 (Copper): 2.8mg, E5 (Manganese): 0.9mg, E6 (Zinc): 9mg.</p>\n<p><strong>Analytical constituents: Protein:</strong> 12% - Fat content: 2.8% - Crude ash: 1.5% - Crude fibers: 0.9% - Moisture: 79.5%.</p>\n<p><strong>Feeding Guidelines:</strong></p>\n<table class=\"rc-table-age\">\n<tbody>\n<tr>\n<th>CAT'S WEIGHT</th>\n<th>WET POUCHES ONLY PER DAY</th>\n<th>WET + DRY FOOD PER DAY</th>\n</tr>\n<tr>\n<td>3 kg</td>\n<td>2.5</td>\n<td>1 pouch + 20-25 g dry food</td>\n</tr>\n<tr>\n<td>4 kg</td>\n<td>3</td>\n<td>1 pouch + 35-40 g dry food</td>\n</tr>\n<tr>\n<td>5 kg</td>\n<td>3.5</td>\n<td>1 pouch + 40-45 g dry food</td>\n</tr>\n<tr>\n<td>6 kg</td>\n<td>4</td>\n<td>1 pouch + 45-55 g dry food</td>\n</tr>\n</tbody>\n</table>\n<p><strong>HUFT Tip: </strong>Cats like a varied diet that may include different flavours and textures. Feeding them a mixed diet of dry and wet food will keep them interested in their meals to help maintain a healthy digestive and immune system.</p>",
