  "description": "<p class=\"comp\">Farmina N&amp;D grain free ocean herring and orange is a complete food for Adult Cat. Farmina food is made with the perfect correct amount of vitamins, protein, fats, and advanced minerals. The Natural grain free formula is comprised of animal ingredients and vegetables, fruits, vitamins, and minerals.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>70% animal protein</li>\n<li>30% Fruits, veggies and minerals</li>\n<li>Herring and orange</li>\n<li>Grain Free</li>\n<li>No Artificial Preservatives</li>\n<li>Cruelty Free Research</li>\n<li>Always check the ingredients for possible allergens</li>\n<li>Always check with a vet before you alter your pet's diet</li>\n<li>Have fresh water in an accessible spot for your pet through the day</li>\n<li><span>Diet: Grain-Free, Gluten-Free, Low Glycemic, GMO-Free</span></li>\n</ul>\n<p><strong><span class=\"titoletto\">Ingredients: </span></strong><span data-mce-fragment=\"1\">Herring (32%), dehydrated herring protein (30%), sweet potato, fish oil (from herring), dried eggs, pea fibre, dried carrot, alfalfa meal, inulin, fructo-oligosaccharides, yeast extract (source of manno-oligo-saccharides), dried sweet orange (0.5%), dried apple, dried pomegranate, dried spinach, psyllium husks and seeds (0.3%), dried blueberry, sodium chloride, dried brewers yeast, turmeric (0.2%), aloe vera extract.</span>.</p>\n<p class=\"comp\"><strong>Nutritional Additives:</strong> V<span data-mce-fragment=\"1\">itamin A 18000IU; Vitamin D3 1200IU; Vitamin E 600mg; Vitamin C 300mg; Niacin 150mg; Calcium D-pantothenate 50mg; Vitamin B2 20mg; Vitamin B6 8.1mg; Vitamin B1 10mg; Biotin 1.5mg; Folic acid 1.5mg; Vitamin B12 0.1mg; Choline chloride 2500mg; Beta-carotene 1.5mg; Zinc (Zinc chelate of hydroxy analogue of methionine): 163.80mg; Manganese (Manganese chelate of hydroxy analogue of methionine): 64.60mg; Iron (Iron(II) chelate of glycine hydrate): 58.30mg; Copper (Copper chelate of hydroxy analogue of methionine 15.80mg; DL-methionine, technically pure 5000mg; Taurine 4000mg; L-carnitine 300mg. Sensory additives: green tea extract 100mg; rosemary extract. Antioxidants: tocopherol extracts from vegetable oils.</span></p>\n<p class=\"comp\"><strong>Analytical Compounds:</strong> C<span data-mce-fragment=\"1\">rude protein 44.00%; crude fat 20.00%; crude fibres 1.80%; moisture 8.00%; crude ash 8.50%; Calcium 1.00%; Phosphorus 0.90%; Magnesium 0.08%; Omega-6 3.10%; Omega-3 1.40%; DHA 0.80%; EPA 0.50%.</span></p>\n<p class=\"comp\"><span data-mce-fragment=\"1\"><strong>Energy Value:</strong> EM Kcal/Kg 4204 - Mj/Kg 17,59</span></p>\n<p class=\"comp\"><b>HUFT Tip: </b>Your cat's feed portions and diet should suit their lifestyle. If your cat is not very active then alter their diet accordingly (in consultation with a pet nutritionist) to ensure that your pet does not become overweight.</p>",
