  "description": "<p>Whiskas Mackerel is a nourishing diet for your adult cat. This dry food formula contains real mackerel and poultry ingredients which provide high-quality protein to strengthen your pet's muscles. Vitamin E and Taurine keep the heart and immune system healthy while calcium and phosphorous helps maintain healthy teeth and bones.</p>\n<p>Whiskas creates nutritious and irresistible food for cats in collaboration with the experts at the WALTHAM Centre for Pet Nutrition. Whiskas cat food contains a unique patented combination of zinc + omega 6 fatty acids that help improve the skin and coat.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Food Type: Dry cat food</li>\n<li>Suitable for adult cats above 1 year</li>\n<li>Contains mackerel and poultry</li>\n<li>Patent protected combination of zinc + omega 6 fatty acids</li>\n<li>AAFCO Approved</li>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never feed above recommended quantities unless prescribed by a vet</li>\n</ul>\n<p><strong>HUFT Tip: </strong>Cats enjoy a varied diet (as they would have in the wild). Make sure that you offer them different foods from time to time so your pet has a varied diet. Always keep fresh water for them.</p>\n<p><strong>Feeding Guide: </strong>Feeding requirements will vary based on your pet's level of activity, environment and age.</p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/1_d3bc06ec-75ac-4833-88e4-20a4c76afee6_large.JPG?v=1556951119\" alt=\"\"></p>\n<p><strong>Please Note: </strong>This is just an initial guide, we suggest you check with a vet for specific changes in quantity to suit your pet.</p>\n<p><strong>Ingredients: </strong>Wholegrain cereals (corn, rice, wheat), corn gluten meal, poultry and poultry by-products, soy bean products, (full fat soy bean, soybean meal) palm stearin, ocean fish, wheat flour, minerals, iodised salt, vitamins, taurine, soy oil, methionine, food colouring, preservatives, flavour.</p>\n<p><strong>Analytical Constituents (%):</strong></p>\n<p><strong><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/1.1_ac46223e-784d-4575-a916-06aee6aca4f7_large.JPG?v=1556951124\" alt=\"\"></strong></p>",
