  "description": "<p>Schesir Chicken Fillet Canned Cat Food is a protein dense wet food that comes packed in tasty jelly. Your cat will love the texture and taste of this food! Humanely raised chicken that has been hand processed and lightly steamed goes into every can. In fact, only the best cuts of meat are used in Schesir canned cat food formulas. This food is free from artificial colours or preservatives, too. It contains all of the nutrition your cat needs to thrive, no matter their age. Feed it as a complete meal, or try mixing it with your cat's favourite kibble. Aloe Canned Cat Food is a complete and balanced diet for cats of all ages. This interesting flavour is nutrient dense and has everything your cat needs to thrive. It is a tasty option for cats of all ages. Schesir foods are free from artificial colours or preservatives.</p>\n<p><strong>Composition:</strong></p>\n<ul>\n<li>Chicken fillets 61%.</li>\n<li>Aloe 4.7%.</li>\n<li>Sunflower oil 1.4%.</li>\n<li>Rice 1%.</li>\n</ul>\n<p><strong>Analytic components:</strong></p>\n<ul>\n<li>Protein 11%</li>\n<li>Crude oils and fats 1%</li>\n<li>Crude fibers 0.1%</li>\n<li>Crude ash 1%</li>\n<li>Moisture 86%</li>\n<li>81.6 kcal/100 g</li>\n</ul>\n<p><strong>Ingredients:</strong></p>\n<p><b>Chicken: </b>The chickens used in organic products are bred in Germany and Holland according to the rules laid down for organic farming. Chickens used in Schesir wet products are bred in Thailand, following the hygienic-sanitary guidelines provided by the European Regulations. They belong to the species Gallus domesticus, of the Phasianidae family (birds of Indian origin). The chicken contains proteins of high biological value, which provide all the amino acids the pet needs.<br><b></b></p>\n<p><b>Aloe: </b>Succulent plant Aloe barbadensis Miller, from the Aloeaceae family. It comes from local crops to reduce the impact of transport on the production process. It is a perennial shrub of which the fleshy leaves are used. It is a topping in Schesir wet products to give more flavor to the recipe and as a source of fiber.</p>",
