  "title": "Farmina Matisse Premium Salmon & Tuna Dry Cat Food",
  "handle": "matisse-premium-dry-cat-food-salmon-tuna",
  "description": "<p>This premium feline food from Matisse features salmon and tuna as their main ingredients. It is rich in taurine (an essential nutrient for cats) and is highly digestible. The Matisse Premium Dry Cat Food is a complete food for cats.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Rich in taurine</li>\n<li>Highly digestible</li>\n<li>Cruelty Free research</li>\n<li>Always have fresh water available for your pet</li>\n<li>Check with a vet before you alter your pet's diet</li>\n<li>Check for possible allergens</li>\n<li>Feed recommended quantities</li>\n</ul>\n<p><strong>Composition: </strong>Dehydrated fish (salmon 10%, tuna 10%), rice (20%), dehydrated chicken meat, corn, chicken fat, hydrolyzed animal proteins, dried beetroot pulp, fish oil, vegetable oil, corn gluten, dehydrated whole eggs, sodium chloride, potassium chloride, dehydrated calcium sulfate, dried brewer's yeast.</p>\n<p><strong>Nutritional additives:</strong> <span data-mce-fragment=\"1\">Vitamin A 16000IU; Vitamin D3 1600IU; Vitamin E 160mg; Vitamin C 160mg; Niacin 40mg; Calcium D-pantothenate 16mg; Vitamin B2 8mg; Vitamin B6 6.4mg; Vitamin B1 4.8mg; Biotin 0.4mg; Folic acid 0.48mg; Vitamin B12 0.06mg; Choline chloride 2200mg; Zinc (Zinc oxide): 86.7mg; Zinc (Zinc sulphate monohydrate): 43.7mg; Manganese (Manganous sulphate monohydrate): 48.8mg; Iron [Iron (II) sulphate monohydrate]: 14.5mg; Iron [Iron (II) carbonate]: 28.9mg; Copper [Copper (II) sulphate pentahydrate]: 12.8mg; Iodine (Calcium iodate anhydrous): 1.56mg; Selenium (Sodium selenite): 0.101mg; DL-methionine, technically pure 3000mg.</span></p>\n<p><strong>Analytical Compounds: </strong><span data-mce-fragment=\"1\">Crude protein 32.00%; crude fat 11.00%; crude fibres 1.20%; crude ash 6.60%; Calcium 1.00%; Phosphorus 0.90%; Magnesium 0.08%; Taurine 1800mg/kg.</span></p>\n<p><strong>HUFT Tip: </strong>Cats are obligate carnivores, this means that they derive some of their essential nutrients from meat. These nutrients are not present in veg food and so cats must have meat in their diet.</p>",
