  "id": 2239219171390,
  "title": "Sheba Melty Maguro Tuna & Seafood Flavour Cat Treat - 48 g Packs",
  "handle": "sheba-cat-food-maguro-tuna-seafood-flavour-pack-of-12-12-x-48-gms",
  "description": "<div id=\"dpx-product-description_feature_div\">\n<div id=\"descriptionAndDetails\" class=\"a-section a-spacing-extra-large\">\n<div id=\"productDescription_feature_div\" class=\"feature\" data-feature-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\">\n<div id=\"productDescription_feature_div\" data-feature-name=\"productDescription\" data-template-name=\"productDescription\" class=\"a-row feature\" data-cel-widget=\"productDescription_feature_div\">\n<div style=\"text-align: start;\" id=\"productDescription\" class=\"a-section a-spacing-small\">\n<p>Sheba cat treats to offer your cat a Maguro Selection in two variants, namely, Tuna and Tuna &amp; Seafood flavours. Made with high-quality ingredients including real chicken/ fish, this delicious pet treat is designed to be delicately hand-fed, the creamy snack allows you to create a special moment with your cat. This complementary cat snack is suited for all cat life stages.<br></p>\n<div class=\"product-attribute__attr--name\"><strong>Key Features:</strong></div>\n<div style=\"text-align: start;\" class=\"product-attribute__attr--description\">\n<ul>\n<li>An irresistible treat for your special furry friend</li>\n<li>Made with high quality ingredients including real chicken/ fish</li>\n<li>High moisture content up to 90%</li>\n<li>Delicious pet treat is designed to be delicately hand fed</li>\n<li>Snack suited for all cat life stages</li>\n<li>Ideal to create a bond with your pet</li>\n</ul>\n<h3 class=\"a-spacing-mini\">Storage Information:</h3>\n<ul>\n<li>Store the pack in a cool, dry and hygienic place. Avoid direct sunlight.</li>\n<li>After opening a stick, please store it in the refrigerator and use soon.</li>\n</ul>\n<div data-mce-fragment=\"1\" style=\"text-align: center;\" data-mce-style=\"text-align: center;\"><img data-mce-fragment=\"1\" style=\"float: none;\" alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/7e5a67ac-016f-42e2-9ae5-58596fe9e640.__CR0_0_300_300_PT0_SX300_V1_240x240.png?v=1627301542\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/7e5a67ac-016f-42e2-9ae5-58596fe9e640.__CR0_0_300_300_PT0_SX300_V1_240x240.png?v=1627301542\" data-mce-style=\"float: none;\"></div>\n<div data-mce-fragment=\"1\" style=\"text-align: center;\" data-mce-style=\"text-align: center;\"><br data-mce-fragment=\"1\"></div>\n<div data-mce-fragment=\"1\" style=\"text-align: center;\" data-mce-style=\"text-align: center;\">\n<h2 data-mce-fragment=\"1\" class=\"a-spacing-mini\">Irresistibly Tasty</h2>\n<h3 data-mce-fragment=\"1\">Containing quality ingredients and delicious fish/ chicken flavours, Sheba Melty has a taste your cat can never resist</h3>\n</div>\n<p data-mce-fragment=\"1\"> </p>\n<div data-mce-fragment=\"1\" style=\"text-align: center;\" data-mce-style=\"text-align: center;\"><img data-mce-fragment=\"1\" style=\"float: none;\" alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/8e6b9f0c-b5a1-4660-883c-46eead200e19.__CR0_0_300_300_PT0_SX300_V1_240x240.png?v=1627301591\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/8e6b9f0c-b5a1-4660-883c-46eead200e19.__CR0_0_300_300_PT0_SX300_V1_240x240.png?v=1627301591\" data-mce-style=\"float: none;\"></div>\n<div data-mce-fragment=\"1\" style=\"text-align: center;\" data-mce-style=\"text-align: center;\"><br data-mce-fragment=\"1\"></div>\n<div data-mce-fragment=\"1\" style=\"text-align: center;\" data-mce-style=\"text-align: center;\">\n<h2 data-mce-fragment=\"1\" class=\"a-spacing-mini\">Creamy Texture</h2>\n<h3 data-mce-fragment=\"1\">It's smooth texture and irresistible flavour attracts even fussy eaters for a fun snack time.</h3>\n</div>\n<p data-mce-fragment=\"1\" class=\"a-spacing-base\"><br data-mce-fragment=\"1\"></p>\n<div data-mce-fragment=\"1\" style=\"text-align: center;\" data-mce-style=\"text-align: center;\"><img data-mce-fragment=\"1\" style=\"float: none;\" alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/1ca01f39-eaec-4821-b60d-ae9b89c1028f.__CR0_0_300_300_PT0_SX300_V1_240x240.png?v=1627301640\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/1ca01f39-eaec-4821-b60d-ae9b89c1028f.__CR0_0_300_300_PT0_SX300_V1_240x240.png?v=1627301640\" data-mce-style=\"float: none;\"></div>\n<div data-mce-fragment=\"1\" style=\"text-align: center;\" data-mce-style=\"text-align: center;\"><br data-mce-fragment=\"1\"></div>\n<div data-mce-fragment=\"1\" style=\"text-align: center;\" data-mce-style=\"text-align: center;\">\n<h2 data-mce-fragment=\"1\" class=\"a-spacing-mini\">Feed by Hand</h2>\n<h3 data-mce-fragment=\"1\">The convenient stick sachet format lets you feed your cat by hand, helping you close the distance to make your cat feel loved</h3>\n<p style=\"text-align: left;\"> </p>\n<div><br></div>\n<h3 class=\"a-spacing-small\">How to Feed Sheba Melty?</h3>\n<br><img src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/e889766d-2214-4ec0-975e-1be861d2b57f._CR0_0_300_300_PT0_SX300_240x240.png?v=1627037067\" width=\"240x240\" height=\"240x240\"><img src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/e1c4e931-dcd6-42b3-8a11-1d405c183ffc._CR0_0_300_300_PT0_SX300_240x240.png?v=1627037077\" width=\"240x240\" height=\"240x240\"><img data-mce-fragment=\"1\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/393c5733-4828-4876-ac86-ded37e896c69._CR0_0_300_300_PT0_SX300_480x480.png?v=1627037086\" width=\"240x240\" height=\"240x240\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/393c5733-4828-4876-ac86-ded37e896c69._CR0_0_300_300_PT0_SX300_480x480.png?v=1627037086\"><br>\n<h3 style=\"text-align: left;\" class=\"a-spacing-mini\"><br></h3>\n<h3 style=\"text-align: left;\" class=\"a-spacing-mini\">How Much Sheba Melty Must Be Fed?</h3>\n<ul>\n<li style=\"text-align: left;\"><span style=\"font-size: 1.4em;\">Sheba Melty must be fed as a snack in addition to a complete and balanced cat food like <span style=\"font-size: 19.6px;\">Whiskas</span>.</span></li>\n<li style=\"text-align: left;\"><span style=\"font-size: 1.4em;\">Recommended 2 sticks a day</span></li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>",
