  "id": 4431349448766,
  "title": "HUFT Cat Mahi Mahi Fish Crunchies - 35 g",
  "handle": "huft-cat-treats-mahi-mahi-fish-bits-35-gms",
  "description": "<p>A low calorie, single ingredient treat for cats, the HUFT Mahi-Mahi fish treats are excellent rewards for felines. They are high in protein and low in saturated fats. These are boneless fillets that are just dehydrated so your cat can have all the natural nutrients and flavor of the fish. They love the slightly crunchy texture as well.<br></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>dehydrated &amp; 100% Natural</li>\n<li>Gluten Free With <span data-mce-fragment=\"1\">Zero Preservatives</span>\n</li>\n<li>Farm Fresh Ingredients</li>\n<li>Highly Nutritious</li>\n<li>No Antibiotics &amp; <span data-mce-fragment=\"1\">No Artificial Sugars</span>\n</li>\n<li>Slow Cooked</li>\n<li>Low in saturated fats and calories with <span data-mce-fragment=\"1\">High protein</span>\n</li>\n<li>Wild-caught fish</li>\n<li>Always have fresh water available for your pet</li>\n<li>Always check ingredients for possible allergens</li>\n<li>Feed according to guidelines on the pack</li>\n</ul>\n<p>We have slow cooked the fish to retain all its nutrients. Mahi mahi fish are an excellent source of selenium, potassium, vitamins B5, B6, B12. These contributes to healthy heart function, muscle function and boost your cat's immunity among other benefits.</p>\n<p><strong>Ingredients (Human Grade): </strong>Mahi Mahi Fish Fillet</p>\n<p><strong>Feeding Recommendation: </strong>Cats: 3/4 pieces/day</p>\n<p><strong>Nutritional Analysis (per 100 g):</strong></p>\n<ul>\n<li>Energy - 109 kcals</li>\n<li>Protein - 24 g</li>\n<li>Total Fat - 0.9 g</li>\n<li>Total Carbohydrates - 0 g</li>\n<li>Cholesterol - 0.094 g</li>\n</ul>\n<p><strong>Note:</strong> Best before 9 months from the manufacturing date</p>",
