  "description": "<p><span data-mce-fragment=\"1\">Gnawlers Smooth Creamy Treat with Crab is a delicious wet treat for your adult cat of any breed. It contains Crab which is full of flavors and contains highly digestible protein for strong muscles. It contains green tea extract which improves the digestive system. Gnawlers Smooth Creamy Treat with Crab contains Taurine which improves the eye sight. It contains fatty acids like Omega 6 which improves the skin and fur coat. It is gluten and preservative free.</span></p>\n<p><strong>Features:</strong></p>\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li><span class=\"a-list-item\">This treat is full of flavors &amp; protein for strong muscles It contains green tea extract which improves the digestive system.</span></li>\n<li><span class=\"a-list-item\">Gnawlers Smooth Creamy Treat is a delicious wet treat for your adult cat of any breed.</span></li>\n<li><span class=\"a-list-item\">It contains omega 6</span></li>\n</ul>\n<p><strong><span class=\"a-list-item\">Feeding guide:</span></strong></p>\n<ul>\n<li>Feed one or two treats per day.</li>\n<li>Simply tear and squeeze the content into a bowl and its ready to eat</li>\n<li>Tear &amp; squeeze the content-and feed it right from the tube.</li>\n<li>You can even add it to the meals as a topper</li>\n<li>Once the individual packet is opened consume within 24 hours.</li>\n</ul>\n<p><strong>Composition: </strong>Tuna, Crab, Potato starch, Konjak gum, Green tea extract, Brewer's yeast.</p>\n<p><strong>Analytical components: </strong>Crude protein (min) 6.0%, Crude fat(min) 0.5%, Crude fiber (max) 0.5%, Crude ash (max) 25% ,Moisture (max)90%:</p>",
