  "id": 7025099210814,
  "title": "Rena's Recipe Kitty Licks Tuna With Scallop Kitten Treat Tubes",
  "handle": "renas-recipe-kitty-licks-tuna-with-scallop-kitten-treat-tubes",
  "description": "<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\">Rena's Kitty Licks Tuna with Scallop is a delectable treat for every adult cat. It contains tuna and is high in fiber, which helps the digestive system. Taurines, which are found in Rena's Kitty Licks Tuna with Scallop, help with vision. It contains Omega 6, Zinc, and DL-Methionine, which help to improve the skin and coat. </span>Made in Thailand. Rich Creamy, Lickable Treat. Tuna with Scallop Flavor. No artificial colors used.</span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Delicious Tuna flavour</li>\n<li>Rich in fiber, helps the digestive system</li>\n<li>Taurine aids the vision</li>\n<li>Contains Omega 6, Zinc and DL-Methionine improve the skin and coat</li>\n</ul>\n<h6>\n<strong style=\"font-size: 1.4em;\" data-mce-style=\"font-size: 1.4em;\">Ingredients: </strong><span style=\"font-size: 1.4em;\" data-mce-style=\"font-size: 1.4em;\">   </span>\n</h6>\n<ul>\n<li>\n<span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"> </span><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Tuna </span>                          </li>\n<li><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Modified tapioca starch</span></li>\n<li><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Flavoring</span></li>\n<li>Guar gum</li>\n<li><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Salmon Oil</span></li>\n<li><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Carrageenan</span></li>\n<li><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Scallop</span></li>\n</ul>\n<p><strong> Guaranteed Analysis:</strong></p>\n<ul>\n<li>Crude Protein(min) 5.00%</li>\n<li>Crude fat(min) 0.45%</li>\n<li>Crude Fiber(max) 0.10%</li>\n<li>Moisture(max) 90.00%</li>\n</ul>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><strong>Recommended Feeding Guideline:</strong>   Adult &gt; 1 Year</span></p>\n<p><strong>Feeding according to cat weight:</strong></p>\n<table>\n<tbody>\n<tr>\n<td>\n<p><b>Cat Weight (Kg)  </b><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">    </span></p>\n</td>\n<td>\n<p><b> Daily Meal (Tube/Day)</b></p>\n<br>\n</td>\n</tr>\n<tr>\n<td>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">1 - 3</span></p>\n</td>\n<td>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">1 - 6</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">3 - 5</span></p>\n</td>\n<td>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">6 - 8</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">5 - 10</span></p>\n</td>\n<td>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">8 - 13</span></p>\n</td>\n</tr>\n</tbody>\n</table>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"> </span><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">100 g = 26.54 Calories</span></p>\n<br>\n<p><strong>Feeding Instructions:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">This treat is meant as a snack and should not replace your cat main diet</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Do not overfeed</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Clean drinking water should be made available to your cat while feeding</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Feed based on cat weight</span></li>\n</ul>\n<style type=\"text/css\"><!--\ntd {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}\n--></style>",
