  "handle": "gnawlers-creamy-treats-salmon-flavour-for-cats-60-g-packs",
  "description": "<div class=\"celwidget\" data-csa-c-id=\"mhxbt-vm67my-gwxtgh-2erfjq\" data-mce-fragment=\"1\" cel_widget_id=\"dpx-product-description_csm_instrumentation_wrapper\">\n<div id=\"descriptionAndDetails\" class=\"a-section a-spacing-extra-large\" data-mce-fragment=\"1\">\n<div id=\"productDescription_feature_div\" class=\"celwidget\" data-feature-name=\"productDescription\" data-csa-c-id=\"167ov5-a6uu6q-xgimk1-lfod9g\" data-mce-fragment=\"1\">\n<div data-mce-fragment=\"1\">\n<div data-feature-name=\"productDescription\" data-template-name=\"productDescription\" id=\"productDescription_feature_div\" class=\"a-row feature\" data-mce-fragment=\"1\">\n<div id=\"productDescription\" class=\"a-section a-spacing-small\" data-mce-fragment=\"1\">\n<p data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Gnawlers Smooth Creamy Treat with Tasty is a scrumptious wet treat for your adult cat of any breed. It contains Tasty Mussel which is full of flavors and contains highly digestible protein for strong muscles. It contains green tea extract which improves the digestive system. Gnawlers Smooth Creamy Treat with Tasty Mussel contains Taurine which improves the eye sight.</span></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"celwidget\" data-csa-c-id=\"rvu186-cmkiyv-d5jpyq-gb7ss0\" data-mce-fragment=\"1\" cel_widget_id=\"dpx-aplus-brand-story_csm_instrumentation_wrapper\">\n<div id=\"aplusBrandStory_feature_div\" class=\"celwidget\" data-feature-name=\"aplusBrandStory\" data-csa-c-id=\"u8629e-7cgiag-n3lkjv-tcvcqr\" data-mce-fragment=\"1\"><strong>Features:</strong></div>\n<div class=\"celwidget\" data-feature-name=\"aplusBrandStory\" data-csa-c-id=\"u8629e-7cgiag-n3lkjv-tcvcqr\" data-mce-fragment=\"1\">\n<ul>\n<li>Taurine- helps to support eye health and brain development.</li>\n<li>Green tea extract- helps to boost the immune system and prevent cavities and tooth decay.</li>\n<li>Gluten-free and free from any artificial preservatives.</li>\n</ul>\n<p><strong>Feeding Guidelines:</strong></p>\n<ul>\n<li>Feed one or two treats per day.</li>\n<li>Simply tear and squeeze the content into a bowl and its ready to eat</li>\n<li>Tear &amp; squeeze the content-and feed it right from the tube.</li>\n<li>You can even add it to the meals as a topper</li>\n<li>Once the individual packet is opened consume within 24 hours.</li>\n</ul>\n<p><strong>Composition: </strong>Tuna, Salmon, Potato starch, Konjak gum, Green tea extract, Brewer's yeast.</p>\n<p><strong>Analytical components: </strong>Crude protein (min) 6.0%, Crude fat(min) 0.5%, Crude fiber (max) 0.5%, Crude ash (max) 25% ,Moisture (max)90%</p>\n</div>\n</div>",
