  "description": "<p data-mce-fragment=\"1\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">The Eco-Friendly HUFT Cat Litter is a 100% safe and chemical-free essential for your cat. It has undergone a rigorous, high heat treatment that makes it a super-absorbent cat litter with excellent odour control. Its also lighter than conventional, hence making it easy to use and dispose of. Made from recycled newspaper, the HUFT Cat Litter is good for the planet and perfect for your cat.</span></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Here What Makes It A Good Buy:</b></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Lighter Than Conventional Litter</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Flushable, Easy To Use &amp; Dispose</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Eco-Friendly: Made From Recycled Newspaper</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Super-Absorbent &amp; Chemical-Free</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Excellent Odour Control</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Absorbs Moisture &amp; Liquid Instantly On Contact</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Low Dust And Reduced Tracking &amp; Stains On the Floor</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\"></b><b data-mce-fragment=\"1\">Storage Instructions:</b></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Store in a cool, dry place away from direct sunlight</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Not to be used if the packaging is damaged</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Directions for use:</b></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Step 1: Take a clean litter tray &amp; fill it with the HUFT Cat Litter (up to 3-4 inches)</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Step 2: Once your cat starts using it, scoop out the clumps daily &amp; top up the litter when required. Remember: Cats generally do not use unclean litter trays.</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Step 3: Rake the litter regularly to maintain coverage &amp; freshness</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Every week, clean the tray thoroughly &amp; replace with fresh litter</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">HUFT Tip:</b></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\">Cats don;t like sharing their litter. In case you have multiple cats, please get separate litters for each of your cats.</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\">Once your cat starts using it, scoop out the clumps daily &amp; top up the litter when required. Remember: Cats generally do not use unclean litter trays.</span></li>\n</ul>",
