  "handle": "nurture-pro-tofu-cat-litter-soya-flushable-lasts-4-weeks-7-l-2-75kg",
  "description": "<p>Made with natural Tofu, which is an effective counter to the smell of ammonia in cat's urine while providing outstanding odour control. Say goodbye to stinky cat litter boxes. <span>Plus, our cat litter provides fast clumping action and non-stick solutions to our fellow cat lovers. Unlike clay or silica litter, Nurture Pro Tofu Cat Litter is primarily made up of 100% Biodegradable and Flushable materials. No more overloaded rubbish bins as you have an alternative method of disposing of used cat litter.</span><span><br></span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li class=\"first\"><span>Made with all-natural Tofu without chemicals</span></li>\n<li><span>Amazing Odour control</span></li>\n<li><span>Extremely gentle on your feline's paws</span></li>\n<li><span>99% Dust Free</span></li>\n<li><span>Easy to scoop</span></li>\n<li><span>Fast Clumping</span></li>\n<li><span>Super Lightweight</span></li>\n<li><span>Flushable and easy to dispose</span></li>\n<li class=\"last\"><span>No Tracking</span></li>\n</ul>\n<p><strong>Ingredients:</strong></p>\n<ul>\n<li>Tofu.</li>\n<li>Corn Starch.</li>\n<li>Citric Acid.</li>\n</ul>\n<p><b>Getting's</b><strong> started with the litter:</strong></p>\n<div class=\"col-md-12\"><img src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Nurture_Pro_Tofu_Cat_litter_Green_Tea_1_480x480.jpg?v=1576740234\" alt=\"\"></div>\n<div class=\"col-md-12\">\n<p><span><strong>Step 1:</strong></span><span>Fill a clean litter tray with one to two inches (2-5 cm) of Nurture Pro Tofu Cat Litter</span></p>\n<p><span><strong>Step 2</strong></span><span>: Remove the clumps and dispose of responsibly. Note that Nurture Pro Tofu Cat Litter is </span><span>biodegradable and is flushable in small quantities.</span></p>\n<p><span><strong>Step 3</strong></span><span>: Add more Nurture Pro Tofu Cat Litter to refresh your litter box after each removal of waste.</span></p>\n<p><strong>Precautions:</strong><br></p>\n<ul>\n<li><span>Recommended to maintain at least two inches (5 cm) of litter at all times.</span></li>\n<li><span>Empty entire litter tray for fresh cat litter once a month.</span></li>\n</ul>\n</div>",
