  "title": "Intersand Odourlock with Minerals Clumping Cat Litter",
  "handle": "intersand-odourlock-mineral-with-smart-odour-shield-technology-clumping-cat-litter",
  "description": "<p>Odourlock's super fast clumping feature makes scooping easier and cuts down on the amount of litter you use ( 45% less/year). Made with 100% pure clay, it is 99.9 % dust free, reducing the risk of respiratory issues for you and for your pet!<span>OdourLock litter neutralizes ammonia formation for unparalleled control of urine and feces odours. Cat urine does not contain ammonia per se; rather, it is formed in the litter box when the urine comes into contact with oxygen and develops bacteria. Ammonia is responsible for the unpleasant smell that comes from the litter box. Our technology is activated when it comes into contact with urine to neutralize odours for more than 40 days. OdourLock is perfect for a multi-cat environment: Just scoop once a day for optimal cleanliness that will delight you and your cats!</span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Optimal odour control for more than 40 days</li>\n<li>Safe for the respiratory tracts of humans and cats</li>\n<li>Quick and easy cleaning for a multi-cat environment</li>\n<li>Moisture-activated scent</li>\n<li>Tested by veterinarians</li>\n</ul>\n<p><strong>HUFT Tip:</strong> You should never flush clumping litter as it can cause blocks. Scoop up the clumps and toss them in the bin instead.</p>",
