  "title": "Signature Grain Zero Cat Litter - For All Cats And Small Animals - 8 kg",
  "handle": "signature-grain-zero-cat-litter-for-all-cats-and-small-animals",
  "description": "<p><span style=\"font-weight: 400;\">Crafted with 100% bentonite clay, this natural Grain Zero premium cat litter offers the perfect balance of heavy non-tracking granules with a medium-grain clay. What does that do? </span></p>\n<p><span style=\"font-weight: 400;\">The hard clumping medium-grain clay effectively blocks moisture from seeping into the tray's bottom and also ensures there's minimum tracking. The hard clumps will not break down easily, making scooping the litter a super easy task. The low dust and hypoallergenic formula makes it ideal for both cats and their parents suffering from allergies. </span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\">Designed for single or multi-cat households, Signature's Grain Zero Cat litter has a strong odour control. The lavender fragrance will keep your home smelling fresh and clean between litter box cleanings.</span></p>\n<p data-mce-fragment=\"1\"><b>How To Use:</b></p>\n<ol>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Pour cat litter in the litter box. </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Dispose the collected clumps in a sealed bag after every use. </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Refresh the litter if it runs low.</span></li>\n</ol>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Premium bentonite clay cat litter with lavender scent </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made of non-tracking granules and medium-grain clay</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hard clumping make it easy to scoop </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Ensures minimum tracking </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Low dust and hypoallergenic formula </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Superior odour control </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Lavender scented for a refreshing smell </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Ideal for cats and parents suffering from allergies</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Can also be used for small animals.</span></li>\n</ul>\n<p><b>Disclaimer: </b></p>\n<ol>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">If the litter smells bad, it shows that the adsorption of the cat litter has been saturated. At this time, please add fresh cat litter. </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The cat litter cannot be recycled. Always use a sealed bag to dispose off the cat litter in a non-recyclable dustbin. </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not flush the litter to avoid blocking the pipeline. </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not let children play with it. </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remember to wash your hands afterwards. </span></li>\n</ol>",
