  "title": "Cat's Best Cat Litter - Original (Clumping & Encapsulating Cat Litter)",
  "handle": "cat-s-best-cat-litter-original-clumping-encapsulating-cat-litter",
  "description": "<p>Cat's Best Cat Litter - Original is able to absorb and trap litter box liquids and odours up to 7 times its own volume. It uses the natural properties of active wood fibres to do this.</p>\n<p>Thanks to its odour-neutralising properties, the litter needs to be emptied out only once in 7 weeks! In the meantime, just scoop out the clumps and toss them in the bin. This makes choosing this litter economical without compromising on hygiene.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Clumping cat litter</li>\n<li>Biodegradable, sustainably-made</li>\n<li>Low-dust</li>\n<li>Economical to use</li>\n<li>100% natural, no added chemicals</li>\n<li>Low-dust</li>\n<li>PEFC-certified secondary raw wood materials</li>\n</ul>\n<p><strong>HUFT Tip: </strong>Place litter trays in areas where there is minimal foot traffic but isn't difficult to get to. Cats enjoy quiet spots that are easy to reach. They will appreciate the privacy. Choose a spot that is far from their food and water bowls as well.</p>",
