  "handle": "intersand-odourlock-mineral-calming-breeze-with-multi-formula-cat-litter-12-kg",
  "description": "<p><span data-mce-fragment=\"1\">OdourLock mineral litter is produced from high-quality clay, 100% pure and natural, for maximum efficiency without compromise: OdourLock litter neutralizes ammonia formation for unparalleled control of urine and feces odours. Cat urine does not contain ammonia per se; rather, it is formed in the litter box when the urine comes into contact with oxygen and develops bacteria. Ammonia is responsible for the unpleasant smell that comes from the litter box. Our technology is activated when it comes into contact with urine to neutralize odours for more than 40 days. OdourLock is perfect for a multi-cat environment: Just scoop once a day for optimal cleanliness that will delight you and your cats!</span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li><span data-mce-fragment=\"1\">Optimal odour control for more than 40 days</span></li>\n<li><span data-mce-fragment=\"1\">Safe for the respiratory tracts of humans and cats</span></li>\n<li><span data-mce-fragment=\"1\">Quick and easy cleaning for a multi-cat environment</span></li>\n<li><span data-mce-fragment=\"1\">Moisture-activated scent</span></li>\n<li><span data-mce-fragment=\"1\">Tested by veterinarians</span></li>\n</ul>",
