  "description": "<meta charset=\"utf-8\">\n<p data-mce-fragment=\"1\">This will help minimize messes and make it easier for you to scoop. This Bentonite Cat Litter is made with 100% Natural Wyoming Bentonite which is completely safe for your cat and kittens. This cat litter is granulated clay-based. Bentonite cat litter is one of the most convenient ways to control the mess and odor.</p>\n<p data-mce-fragment=\"1\">Emily pets bring to you the new generation clay cat litter. We are an enterprise, in the spirit of win-win with customers<span class=\"a-text-bold\" data-mce-fragment=\"1\">Emily Pets Bentonite Cat Litter </span><span data-mce-fragment=\"1\"></span>leads to<span data-mce-fragment=\"1\"></span><span class=\"a-text-bold\" data-mce-fragment=\"1\">Control Odor</span>,<span class=\"a-text-bold\" data-mce-fragment=\"1\">Great Clumping</span>,<span data-mce-fragment=\"1\"></span><span class=\"a-text-bold\" data-mce-fragment=\"1\">Dust-free</span>, and<span data-mce-fragment=\"1\"></span><span class=\"a-text-bold\" data-mce-fragment=\"1\">Lightweight</span>. With the Clump Lock Technology, Bentonite Cat Litter absorbs liquid and forms tight clumps and leaves behind no stinky crumbles. Clay-based granules help to create rock-solid clumps and make the scooping easy. The moisture activated particles make a tight seal around the cat waste.</p>\n<p data-mce-fragment=\"1\">The low-dust formula enables a clean, easy-pour to minimize messes and making litter box maintenance a simple task for you. With our premium cat litter, the odor vanishes in no time. Along with that, it leaves behind a pleasant aroma.</p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Features:</strong></p>\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\" data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">Super Absorbent and Easy To Scoop</span></li>\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">Long-Lasting</span></li>\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">Remarkable Clumping Capabilities</span></li>\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">Remarkable Odor Control</span></li>\n</ul>",
