  "handle": "intersand-clumping-cat-litter",
  "description": "<style type=\"text/css\"><!--\ntd {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}\n--></style>\n<p><span data-sheets-userformat='{\"2\":14653,\"3\":{\"1\":0,\"3\":1},\"5\":{\"1\":[{\"1\":2,\"2\":0,\"5\":{\"1\":2,\"2\":0}},{\"1\":0,\"2\":0,\"3\":3},{\"1\":1,\"2\":0,\"4\":1}]},\"6\":{\"1\":[{\"1\":2,\"2\":0,\"5\":{\"1\":2,\"2\":0}},{\"1\":0,\"2\":0,\"3\":3},{\"1\":1,\"2\":0,\"4\":1}]},\"7\":{\"1\":[{\"1\":2,\"2\":0,\"5\":{\"1\":2,\"2\":0}},{\"1\":0,\"2\":0,\"3\":3},{\"1\":1,\"2\":0,\"4\":1}]},\"8\":{\"1\":[{\"1\":2,\"2\":0,\"5\":{\"1\":2,\"2\":0}},{\"1\":0,\"2\":0,\"3\":3},{\"1\":1,\"2\":0,\"4\":1}]},\"11\":4,\"14\":{\"1\":3,\"3\":1},\"15\":\"Times New Roman\",\"16\":10}' data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;Innovative, hygienic and simple to use, Intersands' Cat Litter - Exclusive is a highly absorbent, dust free, quick-clumping formula that lets you easily scoop out the source of odours to keep your cat's litter box fresh at all times. This 10 kilogram pack is baby powder scented in order to emit a subtle masking odour. This superior quality litter meets all your needs in terms of cleanliness! With an absorption level of 350%, your feline friend is bound to enjoy a healthy environment. After all, a healthy kitty is a happy kitty! &quot;}\">Innovative, hygienic and simple to use, Intersands' Cat Litter - Exclusive is a highly absorbent, dust free, quick-clumping formula that lets you easily scoop out the source of odours to keep your cat's litter box fresh at all times. This 10 kilogram pack is baby powder scented in order to emit a subtle masking odour. This superior quality litter meets all your needs in terms of cleanliness! With an absorption level of 350%, your feline friend is bound to enjoy a healthy environment. After all, a healthy kitty is a happy kitty! </span><br></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Optimal odour control for more than 40 days</li>\n<li>Safe for the respiratory tracts of humans and cats</li>\n<li>Quick and easy cleaning for a multi-cat environment</li>\n<li>Moisture-activated scent</li>\n<li>Tested by veterinarians</li>\n</ul>\n<p><strong>HUFT Tip:</strong> Never flush scoop-able litter, it can cause blocks. You should just dispose of the clumps with household waste.</p>",
