  "title": "Emily Pets Fresh Scented Bentonite Clumping Cat Litter Lavender",
  "handle": "emily-pets-fresh-scented-bentonite-cat-litter-lavender",
  "description": "<p data-mce-fragment=\"1\">This will help minimize messes and make it easier for you to scoop. This Bentonite Cat Litter is made with 100% Natural Wyoming Bentonite which is completely safe for your cat and kittens. This cat litter is granulated clay-based. Bentonite cat litter is one of the most convenient ways to control the mess and odor.</p>\n<p data-mce-fragment=\"1\">Emily pets bring to you the new generation clay cat litter. We are an enterprise, in the spirit of win-win with customers<span data-mce-fragment=\"1\" class=\"a-text-bold\">Emily Pets Bentonite Cat Litter</span><span data-mce-fragment=\"1\"></span>leads to<span data-mce-fragment=\"1\"></span><span data-mce-fragment=\"1\" class=\"a-text-bold\">Control Odor</span>,<span data-mce-fragment=\"1\"></span><span data-mce-fragment=\"1\" class=\"a-text-bold\">Great Clumping</span>,<span data-mce-fragment=\"1\"></span><span data-mce-fragment=\"1\" class=\"a-text-bold\">Dust-free</span>, and<span data-mce-fragment=\"1\"></span><span data-mce-fragment=\"1\" class=\"a-text-bold\">Lightweight</span>. With the Clump Lock Technology, Bentonite Cat Litter absorbs liquid and forms tight clumps and leaves behind no stinky crumbles. Clay-based granules help to create rock-solid clumps and make the scooping easy. The moisture activated particles make a tight seal around the cat waste.</p>\n<p data-mce-fragment=\"1\">The low-dust formula enables a clean, easy-pour to minimize messes and making litter box maintenance a simple task for you. With our premium cat litter, the odor vanishes in no time. Along with that, it leaves behind a pleasant aroma.</p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Features:</strong></p>\n<ul data-mce-fragment=\"1\" class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\" class=\"a-list-item\">Super Absorbent and Easy To Scoop</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\" class=\"a-list-item\">Long-Lasting</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\" class=\"a-list-item\">Remarkable Clumping Capabilities</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\" class=\"a-list-item\">Remarkable Odor Control</span></li>\n</ul>\n<h3 data-mce-fragment=\"1\" class=\"a-spacing-mini\">How To Use ?</h3>\n<p data-mce-fragment=\"1\" class=\"a-spacing-base\">It is very easy to use the<span data-mce-fragment=\"1\"></span><span data-mce-fragment=\"1\" class=\"a-text-bold\">Emily Pets Bentonite Cat Litter</span></p>\n<ul data-mce-fragment=\"1\" class=\"a-unordered-list a-vertical\">\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\" class=\"a-list-item\"><span data-mce-fragment=\"1\" class=\"a-text-bold\">Step 1:</span><span data-mce-fragment=\"1\"></span>Fill the clean litter tray with approx. Emily Pets Bentonite Cat Litter up to 7-10 CMS</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\" class=\"a-list-item\"><span data-mce-fragment=\"1\" class=\"a-text-bold\">Step 2:</span><span data-mce-fragment=\"1\"></span>Remove solid waste from the litter tray on a daily basis i.e. clumps to maintain freshness</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\" class=\"a-list-item\"><span data-mce-fragment=\"1\" class=\"a-text-bold\">Step 3:</span><span data-mce-fragment=\"1\"></span>Completely replace all of the litter in the litter tray at least once per week.</span></li>\n</ul>\n<p data-mce-fragment=\"1\" class=\"a-spacing-base\">Allow your cat and kittens to feel comfortable, it will take approximately 1 week.</p>\n<p data-mce-fragment=\"1\" class=\"a-spacing-base\"> </p>\n<p data-mce-fragment=\"1\" class=\"a-spacing-base\"> </p>",
